import React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';
import CardMedia from '@mui/material/CardMedia';
export default function House(props) {
  return (
      <div className=" p-3 rounded-lg col-lg-9 col-md-12 hover:shadow-lg ease-linear transition-all  ">
        <div className="  sm:w-fit text-center     sm:py-2">
          <div className="flex max-w-4/12">
            <picture className="max-w-[250px] aspect-square m-2">
              <img
                src={`${props.url}`}
                loading="lazy"
                className="w-full h-full  shadow-lg object-cover"
              />
            </picture>
          </div>
        </div>
        <Card sx={{ maxWidth: 350 }}>
          <CardActionArea>
          <div className="text-center sm:text-start mt-2 sm:mt-0 sm:ml-4 md:mx-6 sm:py-2"></div>
            <CardContent>
              <Typography gutterBottom variant="h5" component="div">
              {props.name}
              </Typography>
              <Typography variant="body2" color="text.secondary">
              {props.intro}
              </Typography>
            </CardContent>
            <CardActions>
            <Button size="small">評分:{props.score.toFixed(1)}</Button>
            <Button size="small">價格:{props.price}</Button>
            <Button size="small">地點:台北市</Button>
          </CardActions>
          </CardActionArea>
        </Card>
      </div>
  );
}
